import React from "react";
import {
  Button,
  Header,
  Icon,
  Image,
  Menu,
  Segment,
  Sidebar
} from "semantic-ui-react";

class AnnotSidebar extends React.Component {
  renderFullAnnot() {
    console.log("full annot info:", this.props.fullAnnots.annotData);
    return (
      <div>
        <div>{this.props.fullAnnots.annotData.text}</div>
      </div>
    );
  }

  render() {
    return (
      <div>
        <Menu.Item as="a">
          <Icon name="home" />
          Home
        </Menu.Item>
        <Menu.Item as="a">
          <Icon name="gamepad" />
          Games
        </Menu.Item>
        <Menu.Item as="a">
          <Icon name="camera" />
          Channels
        </Menu.Item>
        <Menu.Item>
          <p>{this.renderFullAnnot()}</p>
        </Menu.Item>
      </div>
    );
  }
}

export default AnnotSidebar;
